import React from 'react';
import './App'

function App() {
  return (
    <div className='app-wrapper'>
      <header>
        <img src='https://cdn.dribbble.com/users/182238/screenshots/2383317/lion2.jpg'/>
      </header>
      <nav>
        <div>
          Profile
        </div>
        <div>Messages</div>
      </nav>
      <div>
        Main content
      </div>
    </div>
  );
}

export default App;
